import React from 'react';

function App(){

    const [categories, setCategories] = useState([]);

    useEffect(() => {
      const fetchCategories = async () => {
        try {
          const { data } = await Axios.get(`/api/products/categories`);
          setCategories(data);
        } catch (err) {
          toast.error(getError(err));
        }
      };
      fetchCategories();
    }, []);

    console.log(categories);

    return(
        <h1>MERN APP</h1>
    );
}

export default App;
